    calculate() {
      // Causes calculate button to show loading icon
      this.calculateLoading = true; // Allows form errors to be displayed

      this.submittedCalc = true; // Return if forms are invalid

      if (!this.landingFuelForm.valid || !this.baggageForm.valid) {
        this.calculateLoading = false;
        return;
      }

      const pilot1Name = document.getElementById('Pilot1ProfileSelect');
      const pilot2Name = document.getElementById('Pilot2ProfileSelect');

      if (pilot1Name.value === 'Choose Pilot 1' || pilot2Name.value === 'Choose Pilot 2') {
        this.alertService.error('Please select pilots.');
        this.calculateLoading = false;
        return;
      }

      const aircraftProfileName = document.getElementById('AircraftProfileSelect');

      if (aircraftProfileName.value === 'Choose Profile') {
        this.alertService.error('Please select aircraft profile.');
        this.calculateLoading = false;
        return;
      }

      const landingFuel = document.getElementById('LandingFuelInput');
      this.landingFuel = Number(landingFuel.value);

      if (landingFuel.value === '' || !landingFuel.value.match(/^[0-9]/)) {
        this.alertService.error('Please input landing fuel.');
        this.calculateLoading = false;
        return;
      }

      if (this.runwayConditions === undefined) {
        this.alertService.error('Please input runway conditions.');
        this.calculateLoading = false;
        return;
      }

      if (Number(landingFuel.value) > this.currentProfile.internalTank + this.currentProfile.underwingTank + this.currentProfile.tipTank) {
        this.alertService.error('Landing fuel cannot be greater than takeoff fuel.');
        this.calculateLoading = false;
        return;
      }

      let pilot2 = this.pilot2.mass; // Remove parachute weight if not present

      if (!this.parachute2) {
        pilot2 -= 36;
      }

      const landingWeight = this.weightSum - (this.currentProfile.internalTank + this.currentProfile.tipTank + this.currentProfile.underwingTank - Number(landingFuel.value)) * 6.815; // Create calculator input

      const calculatorInput = new CalculatorInput(this.currentProfile, landingWeight, this.runwayConditions, this.pilot1.mass, pilot2, this.baggage1, this.baggage2); // Make call to backend for calculation

      this.restClassifier.post(`calculate`, calculatorInput).pipe(first()).subscribe(res => {
        this.performanceOutput = res.data.calculatorOutput;

        if (this.performanceOutput.accelStopDistance + this.performanceOutput.groundRunDistance > this.runwayConditions.runwayLength * 3.28084) {
          this.tooHeavy = true;
