        takeoffPlane.style.left = takeoffLineDistance.toString() + '%';
        const landingLineDistance = 100 * (this.performanceOutput.landingDistance / (this.runwayConditions.runwayLength * 3.28084));
        const landingLine = document.getElementById('landing-red-line');
        landingLine.style.width = landingLineDistance.toString() + '%';
        this.displayPlanes = 'block';
        this.displayPerformance = 'block';
        document.getElementById('main-container').style.opacity = '40%';
        this.submittedCalc = false;
        const date = Date.now();
        let latest_date = this.datepipe.transform(date, 'dd-MM-yyyy'); // Reformatting input and output to have less decimals to look prettier

        const newRunwayConditions = new RunwayConditions(this.runwayConditions.airportID, this.runwayConditions.temp.toFixed(1), this.runwayConditions.pressureAltitude.toFixed(0), this.runwayConditions.precipitation.toFixed(2), this.runwayConditions.headWind.toFixed(1), this.runwayConditions.runwayLength.toFixed(0), this.runwayConditions.runwayType, this.runwayConditions.slope.toFixed(2));
        const newCalcInput = new CalculatorInput(this.currentProfile, calculatorInput.landingMass, newRunwayConditions, this.pilot1.mass, this.pilot2.mass, this.baggage1, this.baggage2);
        const newCalcOutput = new CalculatorOutput(Number(this.performanceOutput.groundRunDistance.toFixed(0)), Number(this.performanceOutput.takeoffSpeed.toFixed(0)), Number(this.performanceOutput.takeoffDistance.toFixed(0)), Number(this.performanceOutput.accelStopDistance.toFixed(0)), Number(this.performanceOutput.speedOverObstacle.toFixed(0)), Number(this.performanceOutput.stallSpeedVS1.toFixed(0)), Number(this.performanceOutput.landingDistance.toFixed(0)), Number(this.performanceOutput.approachSpeed.toFixed(0)), Number(this.performanceOutput.touchDownSpeed.toFixed(0)), Number(this.performanceOutput.stallSpeedVS0GD.toFixed(0)), Number(this.performanceOutput.stallSpeedVS0GU.toFixed(0)));
        const activityLog = new ActivityLog(localStorage.getItem('username'), latest_date, 'calculate', JSON.stringify(newCalcInput).replace(/^[\\]/g, ""), JSON.stringify(newCalcOutput).replace(/^[\\]/g, ""));
        this.restClassifier.post('activity-log/save', activityLog).subscribe(res => {
